import React from "react";
import { useSelector } from "react-redux";

import classes from "./KeysList.module.css";
import Key from "./Key";

const KeysList = () => {
  const keys = useSelector((state) => state.keys.keyList);

  return (
    <ul className={classes.keys__list}>
      {keys.length
        ? keys.map((key) => (
            <Key key={key.id} id={key.id} content={key.content} />
          ))
        : ""}
    </ul>
  );
};

export default KeysList;
